import React, { PureComponent } from 'react'
import axios from 'axios'

export default class App extends PureComponent {
  constructor(props) {
    super(props);
    this.state = {
      dataSource: {}
    }
  }

  componentDidMount() {
    const that = this;
    axios.post('https://127.0.0.1:8090/mockData').then(res => {
      if(res.status === 200) {
        that.setState({
          dataSource: res.data.dataSource
        })
      }
    })
    console.log(this.state.dataSource)
  }

  render() {
    return (
      <div>
        123
      </div>
    )
  }
}
